// AppRouter.js
import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';

import HomePage from './pages/home';

const AppRouter = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        {/* Add more routes here as needed */}
      </Routes>
    </Router>
  );
};

export default AppRouter;
